import ChannelProfile from "./ChannelProfile";
import ChannelDescription from "../channel/ChannelDescription";
import Cookies from "universal-cookie";
const ChannelInfoWrapper = () => {
  const cookies = new Cookies();

  return (
    <ChannelInfoStyled>
      <ChannelProfile />
